DROP TABLE IF EXISTS `review`;
CREATE TABLE `review` (
  `Review_id` int(11) NOT NULL AUTO_INCREMENT,
  `indicator_NO` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `email` text CHARACTER SET utf8,
  `comment` longtext CHARACTER SET utf8,
  `status` int(11) DEFAULT '0',
  `date` datetime DEFAULT NULL,
  `file` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `name` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `family` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `admin_id` int(11) DEFAULT NULL,
  `current` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `new` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  PRIMARY KEY (`Review_id`)
) ENGINE=InnoDB AUTO_INCREMENT=208 DEFAULT CHARSET=utf8 COLLATE=utf8_persian_ci;

